window.bookSummaryJSON = "<p>I'm entering the endgame.&nbsp;&nbsp;&nbsp;&nbsp;</p> <p>Even as I gain new allies, new gear, and greater understanding of Albertus' true plans, the odds are growing more extreme.&nbsp;&nbsp;&nbsp;</p> <p>Who can I trust? What is the AI Albertus Magnus trying to accomplish? What happened to archmagus Jeramy, and why is Guthorios massing an undead army so vast that it stretches from horizon to horizon?&nbsp;&nbsp;&nbsp;</p> <p>Any sane player would quit. Any reasonable person would admit defeat.&nbsp;&nbsp;&nbsp;</p> <p>But I've got no choice.&nbsp;&nbsp;&nbsp;</p> <p>I'm going to see this battle through to its bitter end. I'm going to unearth the secrets behind Euphoria Online - or die trying.&nbsp;&nbsp;</p>"; 
